const targetseq = "";

/*     */

let nowfontsize = 30;
let mouseX, mouseY;

document.addEventListener("mousemove", (e) => {
  mouseX = e.clientX;
  mouseY = e.clientY;

  if (mouseX>=1640 && mouseX<=1845 && mouseY>=80 && mouseY<=875) {
    if (document.querySelector('.sidebar').classList.contains("hidden")){
      sidebarVisibility();
    }
  }
  else {
    if (document.querySelector('.sidebar').classList.contains("hidden")===false){
      sidebarVisibility();
    }
  }
})

function zoomIn() {
  nowfontsize ++;
  if (document.getElementById("feature1")!==null) {
    feature1();
  }
  if (document.getElementById("feature2")!==null) {
    feature2();
  }
  if (document.getElementById("feature3")!==null) {
    feature3();
  }
}

function zoomOut() {
  nowfontsize --;
  if (document.getElementById("feature1")!==null) {
    feature1();
  }
  if (document.getElementById("feature2")!==null) {
    feature2();
  }
  if (document.getElementById("feature3")!==null) {
    feature3();
  }
}

function feature1() {
  document.getElementById("app").innerHTML = `
    <h1 id="feature1" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `
}

function feature2() {
  document.getElementById("app").innerHTML = `
    <h1 id="feature2" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `
}

function feature3() {
  document.getElementById("app").innerHTML = `
    <h1 id="feature3" style="font-size: ${nowfontsize}px">${targetseq}</h1>
  `
}

function sidebarVisibility() {
  document.querySelector('.sidebar').classList.toggle("hidden");
}
